import {StyleSheet} from 'react-native'

const stylesModal = StyleSheet.create({
    container: {
      flex: 1,
      justifyContent: 'center',
      alignItems: 'center',
    },
    modalContainer: {
      flex: 1,
      justifyContent: 'center',
      alignItems: 'center',
      backgroundColor: 'rgba(0, 0, 0, 0.5)',
    },
    modalContent: {
      backgroundColor: 'white',
      padding: 20,
      width: '80%',
      alignItems: 'center',
    },

    modalButtonConteir:{
        display:'flex',
        flexDirection:'row'
    },

    modalButtons:{
        backgroundColor:'grey',
        borderWidth:1,
        width:'55%',
        height:'40%'
    }

});

export default stylesModal;
